  const onhandlebuybutton = () => {
    // navigate('./buy')
  };

  return (
    <>
      <h1>detail</h1>
      <div>
        <button className="buy" onClick={onhandlebuybutton}></button>
        <button className="cart" onClick={onhandlebuybutton}></button>
      </div>
    </>
  );
};

export default BlogUserProduct;
